import React,{Component} from 'react';
import {ListComponent} from './styles/List.style';
import {strings} from '../utils/strings';

class List extends Component {
  render(){
  return (
    <ListComponent>
      {this.props.list && this.props.list.length && this.props.list.map((item,index)=>{
        console.log(item.geometry)
        return(
          <div key={item.geometry.id} className="list-container">
          <div class="list-image" style={{backgroundImage: `url(${item.geometry.photos && item.geometry.photos.length?item.geometry.photos[0].getUrl():''})`}} />
          <div className="list-details">
            <h4>{item.geometry.name}</h4>
            <span className="address">{item.geometry.vicinity}</span>
            <span class="time">{item.geometry.opening_hours}</span>
            <span class="getDirection--link">{item.geometry.opening_hours}</span>
          </div>
          </div>
        );
      })}
    </ListComponent>
    );
  }
}
export default List;
